import React from 'react';
import logo from './logo.svg';
import './App.css';
import Button from '@material-ui/core/Button';
import Container from '@material-ui/core/Button';

function App() {
  return (
    <div className="App">
      <ButtonUI>

      </ButtonUI>
    </div>
  );
}

function ButtonUI()
{
  return (
    <Container fixed>
      <Button variant="contained" color="default">
       Hello World
      </Button>
    </Container>

  );
}



export default App;
